import React from "react";
import "./Polaroid.css";
import Fdf from "views/fdf.jpg";

function Polaroid(props) {
  return (
    <div class="polaroid">
      <img
        src={Fdf}
        alt="Castle"
        style={{ width: "13vw", borderRadius: "8px" }}
      />
      <div class="container">
        <p>{props.texte}</p>
      </div>
    </div>
  );
}

export default Polaroid;
